async function saveSVG() {
  const webView = $("webView");
  const { result } = await webView.exec("app.copySvg()");

  const inputPath = $actions.getVar("filePath");
  if (inputPath && result) {
    const folderPath = inputPath.substring(0, inputPath.lastIndexOf("/") + 1);
    const assetsPath = `${folderPath}/assets`;
    if (!$file.isDirectory(assetsPath)) {
      $file.mkdir(assetsPath);
    }

    const outputName = `${randomText(6)}.svg`;
    const outputPath = `${assetsPath}/${outputName}`;
    $file.write({
      data: $data({ "string": result || `<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 100 100" width="100" height="100"/>` }),
      path: outputPath
    });

    $actions.resolve(`![tldraw](assets/${outputName})`);
  }

  $app.close();
}

function randomText(length) {
  const digits = [];
  const charset = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";
  for (let index = 0; index < length; ++index) {
    digits.push(charset.charAt(Math.floor(Math.random() * charset.length)));
  }
  return digits.join("");
}

function render() {
  $ui.render({
    props: {
      title: "tldraw",
      navButtons: [
        {
          title: $l10n("DONE"),
          handler: saveSVG
        }
      ],
      pageSheet: true
    },
    views: [
      {
        type: "web",
        props: {
          id: "webView",
          html: files["index.html"]
        },
        layout: $layout.fill
      }
    ]
  });
}

render();